function EH.GetTradeskillByMaterial(id)
    id = tonumber(id)

    for tsId, tsData in pairs(EH.rawMaterials) do
        for key, value in pairs(tsData) do
            if value == id then
                return tsId
            end
        end
    end
    return false
end

function EH.IsValidNode(name)
    for k, v in pairs(EH.validNodes[EH.language]) do
        if v == name then
            return true
        end
    end

    return false
end